import React from "react";
import { StyleSheet, Text, View, Dimensions } from "react-native";
import {
  createBottomTabNavigator,
  createAppContainer,
  createSwitchNavigator
} from "react-navigation";
import { createMaterialBottomTabNavigator } from "react-navigation-material-bottom-tabs";
import { createStackNavigator } from "react-navigation-stack";
import Icon from "react-native-vector-icons/Ionicons";
import HomeStack from "./HomeStack";
import ProfileStack from "./ProfileStack";
import PeopleStack from "./PeopleStack";
import Shop from "../Screens/Shop";
import People from "../Screens/People";
import AddStack from "./AddStack";
import Profile from "../Screens/Profile";

const BottomTab = createMaterialBottomTabNavigator({
  HomeStack: {
    screen: HomeStack,
    navigationOptions: {
      tabBarLabel: "Home",
      activeColor: "rgb(95, 32, 155)",
      inactiveColor: "#333",
      barStyle: { backgroundColor: "#fff" },
      tabBarIcon: ({ tintColor }) => (
        <Icon name="home-outline" size={25} color={tintColor} />
      )
    }
  },

  PeopleStack: {
    screen: PeopleStack,
    navigationOptions: {
      tabBarLabel: "Explore",
      activeColor: "rgb(95, 32, 155)",
      inactiveColor: "#333",
      barStyle: { backgroundColor: "#fff" },
      tabBarIcon: ({ tintColor }) => (
        <Icon name="search-outline" size={25} color={tintColor} />
      )
    }
  },

  AddStack: {
    screen: AddStack,
    navigationOptions: {
      tabBarLabel: "Messages",
      activeColor: "rgb(95, 32, 155)",
      inactiveColor: "black",
      barStyle: { backgroundColor: "#fff" },
      tabBarIcon: ({ tintColor }) => (
        <Icon name="chatbox-outline" size={25} color={tintColor} />
      )
    }
  },

  Shop: {
    screen: Shop,
    navigationOptions: {
      tabBarLabel: "Buy n sell",
      activeColor: "rgb(95, 32, 155)",
      inactiveColor: "black",
      barStyle: { backgroundColor: "#fff" },
      tabBarIcon: ({ tintColor }) => (
        <Icon name="cart-outline" size={27} color={tintColor} />
      )
    }
  },

  ProfileStack: {
    screen: ProfileStack,
    navigationOptions: {
      tabBarLabel: "Profile",
      activeColor: "rgb(95, 32, 155)",
      inactiveColor: "black",
      barStyle: { backgroundColor: "#fff" },
      tabBarIcon: ({ tintColor }) => (
        <Icon name="person-outline" size={25} color={tintColor} />
      )
    }
  }
});

export default createAppContainer(BottomTab);

